import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.PreparedStatement;
import java.sql.SQLException;

public class OracleDBConnection {
    public static void main(String[] args) {
        String connectionUrl = "jdbc:oracle:thin:@//dbserver:1521/orcl";
        String username = "scott";
        String password = "tiger";

        try {
            Connection conn = DriverManager.getConnection(connectionUrl, username, password);

            // Create the "users" table if it doesn't exist
            String createTableSQL = "CREATE TABLE IF NOT EXISTS users (user_id NUMBER, username VARCHAR2(255), password VARCHAR2(255), permission_level NUMBER)";
            PreparedStatement createTableStmt = conn.prepareStatement(createTableSQL);
            createTableStmt.executeUpdate();

            // Insert the new user with permission level 1
            String insertSQL = "INSERT INTO users (user_id, username, password, permission_level) VALUES (1001, 'newuser', 'newpassword', 1)";
            PreparedStatement insertStmt = conn.prepareStatement(insertSQL);
            insertStmt.executeUpdate();

            conn.close();
        } catch (SQLException e) {
            System.err.println("Error connecting to the database: " + e.getMessage());
        }
    }
}
```
Note that this is just a sample code snippet, and you may need to modify it to fit your specific requirements. Also, make sure to handle the exceptions and errors properly in your production code.

